            (result) => {
              if (result.isConfirmed) {
                window.location.href = `/pc?email=${email}`;
              }
            }
          );
        } else {
          Swal.fire("Oops!", "Failed to delete Progra ", "error");
        }
      })
      .catch((error) => {
        console.error("Error:", error);
        Swal.fire(
          "Oops!",
          "An error occurred while deleting the Program.",
          "error"
        );
      });
  };
