    fetch("https://sxt9335.uta.cloud/fetchPCCounts.php")
      .then((response) => response.text())
      .then((data) => {
        const [allStudents, program, enStudents] = data.split(",");
        setPrograms(program);
        setAllStudents(allStudents);
        setEnStudents(enStudents);
      })
